import React from 'react';

import { BrowserRouter as Route} from 'react-router-dom';

import LayoutWithRoute from './components/Layout/index';

const App = ({ component: Component, rest }) => {
  return (
        <Route
                {...rest}
                render={(routeProps) => (
                        <LayoutWithRoute>
                                <Component {...routeProps} />
                        </LayoutWithRoute>
                )}
        />
  );
};

export default App;
